INSERT INTO formula (idformula,identificador,nome,conteudo,datacriacao) VALUES (1,'Calculo de ANS Padrão','Calculo de ANS Padrão','if (faturaDTO.getFieldANS() == "valorGlosa"){   var percGlosa = (FormulasUtil.getDoubleValueFromGrid(request,  faturaDTO.getSeqANS(), "valorGlosa") / faturaDTO.getValorExecutadoSomaOS()) * 100;    FormulasUtil.setDoubleValueFromGrid(document, faturaDTO.getSeqANS(), "percentualGlosa",percGlosa );}else{   var valorGlosa = faturaDTO.getValorExecutadoSomaOS() * (FormulasUtil.getDoubleValueFromGrid(request,  faturaDTO.getSeqANS(), "percentualGlosa") / 100);   FormulasUtil.setDoubleValueFromGrid(document, faturaDTO.getSeqANS(), "valorGlosa",valorGlosa);}',NULL);
INSERT INTO formula (idformula,identificador,nome,conteudo,datacriacao) VALUES (2,'CalculoGLOSAOS','Calculo Glosa OS','if (osDTO.getFieldANS() == "custoGlosa"){   var percGlosa = (FormulasUtil.getDoubleValueFromGrid(request,  osDTO.getSeqANS(), "custoGlosa") / osDTO.getExecutadoOS()) * 100;    FormulasUtil.setDoubleValueFromGrid(document, osDTO.getSeqANS(), "percAplicado",percGlosa ); }else{    var valorGlosa = osDTO.getExecutadoOS() * (FormulasUtil.getDoubleValueFromGrid(request,  osDTO.getSeqANS(), "percAplicado") / 100);    FormulasUtil.setDoubleValueFromGrid(document, osDTO.getSeqANS(), "custoGlosa",valorGlosa);}',NULL);
